import{_ as e,c as a,o as r,ab as t}from"./chunks/framework.CUflZczI.js";const h=JSON.parse('{"title":"Аерофрейми","description":"","frontmatter":{},"headers":[],"relativePath":"uk/dev_airframes/index.md","filePath":"uk/dev_airframes/index.md"}'),o={name:"uk/dev_airframes/index.md"},s=t('<h1 id="аерофреими" tabindex="-1">Аерофрейми <a class="header-anchor" href="#аерофреими" aria-label="Permalink to &quot;Аерофрейми&quot;">​</a></h1><p>PX4 має гнучку <a href="./../concept/control_allocation.html">систему розподілу елементів керування</a>, яка дозволяє підтримувати майже будь-який тип/раму транспортного засобу, який можна уявити, за допомогою єдиної кодової бази:</p><ul><li><strong>Літаки:</strong> звичайні літаки, літаючі крила, літаки з перевернутим V-подібним хвостом тощо.</li><li><strong>Мультикоптери:</strong> гелікоптери, трикоптери, квадрокоптери, гексаротори, додекаротори в різних геометріях.</li><li><strong>Airframes VTOL:</strong> конфігурації VTOL, включаючи: Tailsitters, Tiltrotors і QuadPlanes (літак + квадроцикл).</li><li><strong>UGV/Rovers:</strong> базову підтримку додано для безпілотних наземних транспортних засобів, що забезпечує як ручне керування, так і керування на основі завдання.</li></ul><p>Ви можете знайти список усіх підтримуваних типів рам і потужностей двигунів у <a href="./../airframes/airframe_reference.html">Довіднику по планеру</a>.</p><p>У цьому розділі розміщено інформацію, яка має відношення до розробників, які хочуть додати підтримку для нових транспортних засобів або транспортних засобів до PX4, включаючи журнали збірки для транспортних засобів, які все ще розробляються.</p><p>:::note PX4 також добре підходить для використання в інших типах транспортних засобів і звичайних роботів, починаючи від підводних човнів, човнів і транспортних засобів-амфібій до експериментальних літаків і ракет. <em>Повідомте нас</em>, якщо у вас є новий транспортний засіб або тип які ви хочете допомогти підтримати в PX4. :::</p><p>:::note Журнали збірки для деяких підтримуваних планерів можна знайти в розділі <a href="./../airframes/README.html">Конструкції планера/транспортного засобу</a>. :::</p>',7),i=[s];function n(l,_,c,d,m,p){return r(),a("div",null,i)}const u=e(o,[["render",n]]);export{h as __pageData,u as default};
